import './App.css';
import TopLayer from './layout';

import { useSelector, useDispatch } from 'react-redux';
import { fetchPosts } from './redux/action';



function App() {
  const {posts, loading} = useSelector((state: any) => ({...state.data})); 
  const dispatch : any = useDispatch();

  return (
    <div className="App">
    <TopLayer/>
    <button onClick={()=> dispatch(fetchPosts())}>fetch posts</button>
    {!loading ?  (posts.map((post: any)=> <h1>{post.body}</h1>)): <div>loading</div>}
    </div>
  );
}

export default App;
